export const getSalaries = () => {
  return fetch('https://salary-sight-be.herokuapp.com/')
      .then(response => console.log(response.json()))
}

export const postForm = async (formSubmission); {
  const response = await fetch('https://salary-sight-be.herokuapp.com/', {
    method: "POST",
      headers: {
        'Content-Type': 'application/json'
      }
    })
      .then(response => {
        if (!response.ok) {
          throw new Error(`Sorry, we could not process your booking request.`);
        }
        return response.json()
      })
      .then(this.getSalaries())
      .catch(err => console.log(err))
}
